comments.message:
Do you need a return ?

I see this more as 

if (value == nullptr)
{
  messages::internalError(asyncResp->res);
  return;
}

asyncResp->res.jsonValue["Location"]["PartLocation"]["ServiceLabel"] = *value;

Although not wrong, as mentioned on https://gerrit.openbmc-project.xyz/c/openbmc/bmcweb/+/38505/13/redfish-core/lib/managers.hpp#1708

The pattern in other places is 
if (value == nullptr)
{
  BMCWEB_LOG_DEBUG << "Null value returned for locaton code";
  messages::internalError(asyncResp->res);
  return;
 } 

asyncResp->res.jsonValue["Location"]["PartLocation"]["ServiceLabel"] = *value;

Do you mind following that?
